"""Cargamos las imagenes y se especifica a la  API que funciones debe usar (re-escalar, normalizar, etc) para el **preprocesamiento**"""

#Tamaño predeterminado de cada imagen
IMG_WIDTH =256
IMG_HEIGHT = 256

#función resize(dato de entrada, dato de salida, alto, ancho), reescala las imagenes
def resize(inimg,tgimg,height,width):
  inimg = tf.image.resize(inimg,[height,width])
  tgimg = tf.image.resize(tgimg,[height,width])
  return inimg, tgimg

#Normalizar las imagenes para que el procesamiento de las imagenes sea más estable
#Para que se representen en matrices en dominio de -1 a 1
#En este caso el ancho o alto se representa de 0 a 255, por eso buscamos que su división
#por X valor -1 seaga igual a 1
def normalize(inimg,tgimg):
  inimg = (inimg/127.5)-1
  tgimg = (tgimg/127.5)-1
  return inimg,tgimg

@tf.function()
#Aumentación de datos, toma del data set orginal y la trasnforma varias veces para generar
#más imagenes para darle mayor y mejor entrenamiento a la red neuronal
#El paper recomienda aumentar la imagpen de 256 a 286, y después hacer un aleatorio de 256 por 256
#esto hace un desplazamiento horizontal además también hace flips horizontal
def random_jitter(inimg,tgimg):
  #Se reescalan las imagenes
  inimg, tgimg = resize(inimg,tgimg,286,286)

  #Apila las imagenes sobre el mismo eje para que al realizar el corte queden en la misma región
  stacked_image = tf.stack([inimg, tgimg],axis=0)
  #Esta función realiza el corte, el 3 corresponde al canal de color
  cropped_image = tf.image.random_crop(stacked_image,size=[2,IMG_HEIGHT,IMG_WIDTH,3])

  #El preprocesamiento se recupera y se almacena en las variables de entrada
  inimg, tgimg = cropped_image[0], cropped_image[1]

  #Se hace el flip aleatorio
  if tf.random.uniform(()) > 0.5:
    inimg = tf.image.flip_left_right(inimg)
    tgimg = tf.image.random_flip_left_right(tgimg)

  return inimg,tgimg

#La función de carga, sube las imagenes **En este paso solo es para visualizar aun no se cargan todoas**
def load_image(filename, augment=True):
  #El 3 solo perimite 3 canales, RGB
  inimg = tf.cast(tf.image.decode_jpeg(tf.io.read_file(INPATH+'/'+filename)),tf.float32)[...,:3]
  tgimg = tf.cast(tf.image.decode_jpeg(tf.io.read_file(OUTPATH+'/'+filename)),tf.float32)[...,:3]

  inimg, tgimg = resize(inimg,tgimg,IMG_HEIGHT, IMG_WIDTH)

  if augment:
    inimg,tgimg = random_jitter(inimg,tgimg)

  inimg,tgimg = normalize(inimg,tgimg)

  return inimg,tgimg

#El dataset de prueba no requiere aumentación para eso realizamos las siguientes funciones
def load_train_image(filename):
  return load_image(filename,True)

def load_test_image(filename):
  return load_image(filename,False)

