"""**INICIA LA ESTRUCTURA PIX2PIX**

*ENCODER*
"""

from tensorflow.keras import  *
from tensorflow.keras.layers import *

def downsample(filters, apply_batchnorm=True):
  result = Sequential()
  initializer = tf.random_normal_initializer(0,0.02)

#Capa convulocional
  result.add(Conv2D(filters,
             kernel_size=4,
             strides=2,
             padding="same",
             kernel_initializer=initializer,
             use_bias = not apply_batchnorm))
  
  if apply_batchnorm:
    #Capa de BatchNorm
    result.add(BatchNormalization())

#Capa de activación
  result.add(LeakyReLU())
  return result

#Crea minibloques donde se realizan las 3 capas mencionadas, cada vez que se ejecute 
downsample(64)

"""*DECODER*"""

def upsample(filters, apply_dropout=False):
  result = Sequential()
  initializer = tf.random_normal_initializer(0,0.02)

#Capa convulocional inversa
  result.add(Conv2DTranspose(filters,
                             kernel_size=4,
                             strides=2,
                             padding="same",
                             kernel_initializer=initializer,
                             use_bias = False))
#Capa de BatchNorm
  result.add(BatchNormalization())

  if apply_dropout:
    #Capa de Dropout, desconecta ciertas conexiones de la red
    result.add(Dropout(0.5))

#Capa de activación
  result.add(ReLU())
  return result

#Crea minibloques donde se realizan las 3 capas mencionadas, cada vez que se ejecute 
upsample(64)

"""*FUNCIÓN GENERADORA: para la arquitectura* ![image.png](data:image/png;base64,)"""

#Definimos cualquiere dimensión de la imagen pero restringimos el canal de color a 3 (RGB)
#Vienen siendo las capas de la red
def Generator():
  inputs = tf.keras.layers.Input(shape=[None,None,3])

  down_stack = [
    downsample(64,apply_batchnorm=False), # (bs,128,128,64)
    downsample(128),                      # (bs,64,64,128)
    downsample(256),                      # (bs,32,32,256)
    downsample(512),                      # (bs,16,16,512)
    downsample(512),                      # (bs,8,8,512)
    downsample(512),                      # (bs,4,4,512)
    downsample(512),                      # (bs,2,2,512)
    downsample(512),                      # (bs,1,1,512)
  ]

  up_stack = [
    upsample(512,apply_dropout=True),   # (bs,2,2,1024)
    upsample(512,apply_dropout=True),   # (bs,4,4,1024)
    upsample(512,apply_dropout=True),   # (bs,8,8,1024)
    upsample(512),                      # (bs,16,16,1024)
    upsample(256),                      # (bs,32,32,512)
    upsample(128),                      # (bs,64,64,256)
    upsample(64),                       # (bs,128,128,128)
  ]

  initializer = tf.random_normal_initializer(0,0.02)
  last = Conv2DTranspose(filters=3,
                         kernel_size=4,
                         strides = 2,
                         padding = "same",
                         kernel_initializer= initializer,
                         activation = "tanh")
  #imagenes de -1 a 1, la tanh tiene dominio de -1 a 1
  
  #conectamos la red
  x = inputs
  s = []

  concat = Concatenate()

  #Encoder
  for down in down_stack:
    x = down(x)
    s.append(x)

  s = reversed(s[:-1])

  for up, sk in zip(up_stack,s):

    x = up(x)
    x = concat([x,sk])
  
  last=last(x)

  return Model(inputs=inputs,outputs=last)

#Para mostrar si realmente está funcionando, la imagen es basura porque aun no está entrenado
generator = Generator()
