"""![image.png](data:image/png;base64,)

La red patchgan es una red convulucional que devuelve varios resultados donde se evaluan si la región es verdadera o falsa, envés de clasificar con un unico resultado lo hace analizando varias regiones de la imagen

**DISCRIMINADOR:** Recibe la imagen generada y determina si es real o no, usa como entrada la imagen generada y su imagen real
"""

def Discriminator():
  ini = Input(shape=[None, None, 3], name="input_img")
  gen = Input(shape=[None, None, 3], name="gener_img")

  con = concatenate([ini,gen])

  initializer = tf.random_normal_initializer(0,0.02)

#Capas de la red
  down1 = downsample(64, apply_batchnorm=False)(con)
  down2 = downsample(128)(down1)
  down3 = downsample(256)(down2)
  down4 = downsample(512)(down3)

#Se define ultima capa con un unico filtro de salida
#Se define si la region de cada imagen parese real o no
  last=tf.keras.layers.Conv2D(filters=1,
                              kernel_size=4,
                              strides=1,
                              kernel_initializer=initializer,
                              padding="same")(down4)
  #se retorna el modelo discriminador
  return tf.keras.Model(inputs=[ini,gen],outputs=last)
  #probamos si está correcto
discriminator = Discriminator()

"""**Visualización del resultado del discriminador** La intensidad azul se detecta como poco realistas o falsos"""

