"""La función de coste adversaria, une el resultado de cada red"""

loss_object=tf.keras.losses.BinaryCrossentropy(from_logits=True)

def discriminator_loss(disc_real_output,disc_generated_output):
  #Diferencia entre los true por ser real y el detectado por el discriminador
  real_loss=loss_object(tf.ones_like(disc_real_output),disc_real_output)
  #Diferencia entre los false por ser generado y el detectado por el discriminador
  generated_loss=loss_object(tf.zeros_like(disc_generated_output),disc_generated_output)

  total_disc_loss = real_loss + generated_loss

  return total_disc_loss

"""Evaluación del generador, tiene dos objetivos generar la imagen realista maximizar el error del discriminador"""

#Se le da 100 veces más peso al error l1_loss
LAMBDA = 100
def generator_loss(disc_generated_outpout,gen_output,target):

  #Aqui se agregan unos
  gan_loss = loss_object(tf.ones_like(disc_generated_outpout),disc_generated_outpout)

  #mean absolute error, l1_loss diferencia por pixeles
  l1_loss=tf.reduce_mean(tf.abs(target-gen_output))

  total_gen_loss=gan_loss+(LAMBDA*l1_loss)

  return total_gen_loss

